import React, { Component } from "react";
class Body extends Component
{
    constructor(props)
    {

        super(props);

        this.state = {
            name: '',
            password: '',
        };

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        this.setState({
            [event.target.name]: event.target.value
        });
    }

    handleSubmit(event) {
        console.log( JSON.stringify(this.state));
        event.preventDefault();
    }


    render()
    {
        return(
            <div >
                <br/>
                <div className="card box_shw2 border-0 px-3 rounded-2 mb-3 w_500 py-4 mx-auto mt-5">
                        <h1 className="text-center"><b>
                            <span>Wallet as a Service</span>
                        </b></h1>
                    <br/>
                    <div className="card box_shw2 border-0 px-3 rounded-2 mb-3 w_500 py-4 mx-auto mt-5">
                        <form onSubmit={this.handleSubmit}>
                            <h3>Sign In</h3>

                            <div className="form-group">
                                <label>Username</label>
                                <input type="text" className="form-control" placeholder="Enter username" required="required" id="name" name="name" value={this.state.name} onChange={this.handleChange}/>
                            </div>

                            <div className="form-group">
                                <label>Password</label>
                                <input type="password" className="form-control" placeholder="Enter password" required="required" id="password" name="password" value={this.state.password} onChange={this.handleChange}/>
                            </div>


                            <br/>
                            <button type="submit" className="btn btn-primary btn-block">Login</button>
                            <br/>
                            <p className="forgot-password text-right">
                                New User ? <a href="/register"> Register here</a>
                            </p>
                        </form>
                    </div>








                    <br/><br/>

                    <table>
                        <tr>
                            <td>
                                <a href={"/log"}><button className="btn btn-dark floatleft btn-xxl"  >Login</button></a>

                            </td>
                            <td>
                                <a href={"/register"}><button className="btn btn-dark floatright btn-xxl">Register</button></a>

                            </td>
                        </tr>
                    </table>

                </div>
            </div>
        )
    }
}
export default Body;
